import LoadingBarContainer, { LoadingBar } from './LoadingBar';
import loadingBarMiddleware from './LoadingBarMiddleWare';
import {
  hideLoading,
  loadingBarReducer,
  resetLoading,
  showLoading,
} from './loadingBar_ducks';
import ImmutableLoadingBar from './immutable';

export {
  hideLoading,
  ImmutableLoadingBar,
  LoadingBar,
  loadingBarMiddleware,
  loadingBarReducer,
  resetLoading,
  showLoading,
}

export default LoadingBarContainer
